import Sidebar from './Components/Sidebar'

const Mainpage = () => {
  return (
    <div>
      <Sidebar/>
      <Routes>
          <Route path="/Mainpage/Products/AddItem" element={<Add_item/> }/> 
      </Routes>

    </div>
  )
}

export default Mainpage
